<style>
    body,
    html {
        height: 100%;
    }

    .page-error {
        position: relative;
        width: 100%;
        height: 100%;
    }

    .page-error img.logo {
        position: absolute;
        left: 140px;
        top: 50px;
        width: 80px;
        height: 24px;
        cursor: pointer;
    }

    .page-error>div {
        position: absolute;
        left: 50%;
        top: 50%;
        transform: translate(-50%, -50%);
        display: inline-block;
    }

    .page-error>div>img {
        display: block;
        margin: 0 auto;
        width: 460px;
        height: auto;
    }

    .page-error p {
        margin: 35px auto 30px;
        font-size: 18px;
        color: #434C5D;
        letter-spacing: 3px;
        text-align: center;
        cursor: default;
    }

    .page-error .btn-primary.active {
        display: block;
        margin: 0 auto;
        width: 175px;
        height: 46px;
        line-height: 46px;
        color: #fff;
        border: none;
        outline: none;
        background-image: linear-gradient(90deg, #00adff 0%, #0081ff 100%);
        box-shadow: 0 8px 20px 0 rgba(0, 133, 255, 0.3);
        border-radius: 23px;
        transition: width 0.1s ease;
    }

    .page-error .btn-primary.active:hover {
        width: 180px;
    }
</style>
